dictionary = {}
    for i in LETTERS:
        dictionary[i] = [random.randint(0, 100) for _ in range(random.randint(1, 10))]

    sd_dict = {}
    for key, value in dictionary.items():
        sum_value = sum(value)
        mean = sum_value / len(value)
        sum_deviation = 0
        for v in value:
            sum_deviation += (v - mean) ** 2
        standard_deviation = math.sqrt(sum_deviation / len(value))
        sd_dict[key] = standard_deviation

    return sd_dict

